import React from "react";
import "./textinput.css";

class TextInput extends React.Component {
  render() {
    return (
      <div className="text-input">
        <div className="ui form">
          <div className="field">
            <form>
              <label>Escreva sua mensagem</label>
              <input type="text" />
            </form>
          </div>
        </div>
      </div>
    );
  }
}

export default TextInput;
